    name: "BasketbolSuperLigiView",
    component: BasketbolSuperLigiView,
  },
  {
    path: "/bbl",
    name: "BBLView",
    component: BBLView,
  },
  {
    path: "/bnxt",
    name: "BNXTView",
    component: BNXTView,
  },
  {
    path: "/britishbl",
    name: "BritishBasketLeagueView",
    component: BritishBasketLeagueView,
  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
  {
    path: "/plk",
