  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
  {
    path: "/plk",
    name: "PLKView",
    component: PLKView,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
